            var defaultGParam = JToken.Parse("{fs1:{def_s:\"5,11,6,6,10,7,13,8,3,13,5,9,9,6,12,7,13,4,3,13,5,10,5,5,12\",def_sa:\"6,10,3,6,10\",def_sb:\"3,12,4,3,10\",reel_set:\"0\",s:\"5,11,6,6,10,7,13,8,3,13,5,9,9,6,12,7,13,4,3,13,5,10,5,5,12\",sa:\"6,10,3,6,10\",sb:\"3,12,4,3,10\",sh:\"5\",st:\"rect\",sw:\"5\"},fs2:{def_s:\"5,11,6,6,10,7,13,8,3,13,5,9,9,6,12,7,13,4,3,13,5,10,5,5,12\",def_sa:\"6,10,3,6,10\",def_sb:\"3,12,4,3,10\",reel_set:\"0\",s:\"5,11,6,6,10,7,13,8,3,13,5,9,9,6,12,7,13,4,3,13,5,10,5,5,12\",sa:\"6,10,3,6,10\",sb:\"3,12,4,3,10\",sh:\"5\",st:\"rect\",sw:\"5\"},fs3:{def_s:\"5,11,6,6,10,7,13,8,3,13,5,9,9,6,12,7,13,4,3,13,5,10,5,5,12\",def_sa:\"6,10,3,6,10\",def_sb:\"3,12,4,3,10\",reel_set:\"0\",s:\"5,11,6,6,10,7,13,8,3,13,5,9,9,6,12,7,13,4,3,13,5,10,5,5,12\",sa:\"6,10,3,6,10\",sb:\"3,12,4,3,10\",sh:\"5\",st:\"rect\",sw:\"5\"},fs4:{def_s:\"5,11,6,6,10,7,13,8,3,13,5,9,9,6,12,7,13,4,3,13,5,10,5,5,12\",def_sa:\"6,10,3,6,10\",def_sb:\"3,12,4,3,10\",reel_set:\"0\",s:\"5,11,6,6,10,7,13,8,3,13,5,9,9,6,12,7,13,4,3,13,5,10,5,5,12\",sa:\"6,10,3,6,10\",sb:\"3,12,4,3,10\",sh:\"5\",st:\"rect\",sw:\"5\"}}");
            if (dicParams.ContainsKey("g"))
            {
                var gParam = JToken.Parse(dicParams["g"]);
                for (int i = 0; i < 4; i++)
                {
                    var param = string.Format("fs{0}", i + 1);
                    if (gParam[param] == null)
                        gParam[param] = defaultGParam[param];
                }
                dicParams["g"] = serializeJsonSpecial(gParam);
            }
            else
            {
                dicParams["g"] = serializeJsonSpecial(defaultGParam);
            }
        }
        protected override void convertWinsByBet(Dictionary<string, string> dicParams, float currentBet)
        {
            base.convertWinsByBet(dicParams, currentBet);
            if(dicParams.ContainsKey("g"))
            {
                var gParam = JToken.Parse(dicParams["g"]);
                for(int i = 0; i < 4; i++)
                {
                    var param = string.Format("fs{0}", i + 1);
                    if (gParam[param] != null)
                    {
                        int winLineID = 0;
                        do
                        {
                            string strKey = string.Format("l{0}", winLineID);
                            if (gParam[param][strKey] == null)
                                break;

                            string[] strParts = gParam[param][strKey].ToString().Split(new string[] { "~" }, StringSplitOptions.None);
                            if (strParts.Length >= 2)
                            {
                                strParts[1] = convertWinByBet(strParts[1], currentBet);
                                gParam[param][strKey] = string.Join("~", strParts);
                            }
                            winLineID++;
                        } while (true);
                    }
                }
                dicParams["g"] = serializeJsonSpecial(gParam);
            }
        }

        protected override BasePPSlotBetInfo restoreBetInfo(string strUserID, BinaryReader reader)
        {
            var betInfo = new JuicyFruitsMultiholdBetInfo();
            betInfo.SerializeFrom(reader);
            return betInfo;
        }
        protected override BasePPSlotBetInfo newBetInfo()
        {
            return new JuicyFruitsMultiholdBetInfo();
        }
        protected override void readBetInfoFromMessage(GITMessage message, string strGlobalUserID, Currencies currency)
        {
            try
            {
                string strInitString = ChipsetManager.Instance.convertTo(currency, this.InitDataString, this.SymbolName);
                var dicParams = splitResponseToParams(strInitString);

                double minChip = 0.0, maxChip = 0.0;
                getMinMaxChip(dicParams["sc"], ref minChip, ref maxChip);


                var betInfo         = new JuicyFruitsMultiholdBetInfo();
                betInfo.BetPerLine  = (float)message.Pop();
                betInfo.LineCount   = (int)message.Pop();
				
                if (message.DataNum >= 3)
                    betInfo.PurchaseFree = true;
                else
                    betInfo.PurchaseFree = false;
		
                if (betInfo.BetPerLine <= 0.0f)
                {
                    _logger.Error("{0} betInfo.BetPerLine <= 0 in JuicyFruitsMultiholdGameLogic::readBetInfoFromMessage {1}", strGlobalUserID, betInfo.BetPerLine);
                    return;
                }
                betInfo.LineCount = this.ClientReqLineCount;
                BasePPSlotBetInfo oldBetInfo = null;
                if (_dicUserBetInfos.TryGetValue(strGlobalUserID, out oldBetInfo))
                {
                    if (oldBetInfo.HasRemainResponse)
                        return;

                    oldBetInfo.BetPerLine   = betInfo.BetPerLine;
                    oldBetInfo.LineCount    = betInfo.LineCount;
                    oldBetInfo.MoreBet      = betInfo.MoreBet;
                    oldBetInfo.PurchaseFree = betInfo.PurchaseFree;
                }
                else
                {
                    _dicUserBetInfos.Add(strGlobalUserID, betInfo);
                }
            }
            catch (Exception ex)
            {
                _logger.Error("Exception has been occurred in JuicyFruitsMultiholdGameLogic::readBetInfoFromMessage {0}", ex);
            }
        }
	
    }
